import React from 'react'
import "./Landing.css"
// import Shery from "sheryjs";

const Landing = () => {
  return (
    
        <div className='main'>
            <div id='back'>
                <img className='img' src='https://images.unsplash.com/photo-1471565661762-b9dfae862dbe?q=80&w=1470&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt=''/>
                <img className='img' src='https://images.unsplash.com/photo-1594909961938-3d198823a461?q=80&w=1470&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt=''/>
                <img className='img' src='https://images.unsplash.com/photo-1597815303739-dad9f42fcf98?q=80&w=1470&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt=''/>
                <img className='img' src='https://images.unsplash.com/photo-1611283949820-7d50eb837534?q=80&w=1470&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt=''/>
                <img className='img' src='https://images.unsplash.com/photo-1494352026695-c04c8da18a43?q=80&w=1414&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D' alt=''/>
            </div>

            <div id='top'>
                <div id='workingarea'>
                    <div id='heroo'>
                        <div id='heroleft'>
                            <div className='elem'>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                            </div>
                            <div className='elem'>
                                <h1>Gives Zero</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                            </div>
                            <div className='elem'>
                                <h1>Funks.</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                                <h1>David Chang</h1>
                            </div>
                            <button>Explore Now</button>
                        </div>

                        <div id='heroright'>
                            <p>Lorem ipsum dolor sit amet, consectetur.</p>
                            <div id='imgdiv'></div>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>
                            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
  ) 
  
}
  // Add your JavaScript for the carousel here
  let currentIndex = 0;
  const elements = document.querySelectorAll('.elem');
  const back = document.getElementById('back');

  function showElement(index) {
    elements.forEach((element, i) => {
      element.classList.toggle('active', i === index);
    });
  }

  function updateCarousel() {
    const translateValue = -currentIndex * 100 + '%';
    back.style.transform = `translateX(${translateValue})`;
    showElement(currentIndex);
  }

  function nextSlide() {
    currentIndex = (currentIndex + 1) % elements.length;
    updateCarousel();
  }

  setInterval(nextSlide, 3000); // Change slide every 3 seconds

export default Landing
